import { useState, useEffect } from "react";
import axios from "axios";
import "../App.css";

function UpdDelFlight() {
  const [listOfFlights, setListOfFlights] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:8000/admin/showFlight")
      .then((result) => {
        setListOfFlights(result.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div className="listOfFlights">
      {listOfFlights.map((val) => {
        return (
          <div className="flight">
            {" "}
            <h3>{val.flightNumber}</h3> <h3>{val.departureTime}</h3>{" "}
            <h3>{val.arrivalTime}</h3>
            <h3>{val.numberofEconomySeats}</h3> <h3>{val.arrivalDate}</h3>{" "}
            <h3>{val.departureDate}</h3>
            <h3>{val.numberofBusinessSeats}</h3> <h3>{val.airport}</h3>
          </div>
        );
      })}
    </div>
  );
}

export default UpdDelFlight;
